/** @format */

import { Ticket } from '../models/ticket'
import { makeid } from '@/common/lib/makeid'
// tslint:disable:max-line-length

const tickets: Ticket[] = []

const generateTicket = (lotteryId = 'test1'): Ticket => ({
  id: makeid(10),
  amount: Math.round(Math.random() * 10000),
  longString: makeid(255),
  image:
    'data:image/png;base64,',
  walletId: makeid(10),
  purchaseTime: new Date('10/5/2019').toISOString(),
  lotteryId
})

for (let i = 0; i < 50; i++) {
  tickets.push(generateTicket())
}

for (let i = 0; i < 10; i++) {
  const lotteryId = 'test' + i + 2
  tickets.push(generateTicket(lotteryId))
}

export { tickets }
// tslint:enable:max-line-length
